    <title>Cards Back (Page 30 of 41)</title>
    <style>
@page {
  size: A4 portrait;
  margin: 5mm;
}

body {
  margin: 0;
  padding: 0;
  font-family: Arial, sans-serif;
}

.page {
  display: grid;
  grid-template-columns: repeat(3, 60mm); /* 3 columns of 60mm */
  grid-template-rows: repeat(4, 60mm);     /* 4 rows of 60mm */
  gap: 4mm; /* Small gap for easier cutting */
  width: calc(180mm + (4mm * 2)); /* 3 cards + gaps */
  height: calc(240mm + (4mm * 3)); /* 4 cards + gaps */
  margin: 0 auto;
  justify-content: center;
  align-content: center;
  page-break-inside: avoid;
}

.card {
  position: relative;
  width: 60mm;
  height: 60mm;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  box-sizing: border-box;
}

.front {
  text-align: center;
  background: hsl(210, 50%, 90%);
}

.front .artist {
  font-size: 1.2em;
  font-weight: bold;
  margin-top: 2mm;
}

.front .year {
  font-size: 3.5em;
  font-weight: bold;
  margin: auto 0;
}

.front .song-name {
  font-size: 1em;
  margin-bottom: 2.5mm;
}

/* Serial number for both sides in bottom-left visually */
.front .serial-number,
.back .serial-number {
  position: absolute;
  bottom: 1mm;
  left: 1mm;
  font-size: 0.5em;
  color: #333;
}
